import React,{useState} from "react";
import './Result.css';
import {Navigate} from 'react-router-dom';

function Result(){

    const navigate = Navigate();
    const gotoHome = () =>{
        navigate('/home');
    }
    const gotoAdmin=()=>{
        navigate('/admin');
    }

    return (
     <div class="Result">
        <div className="upperTitle">
            <p>MBTI</p>
        </div>

        <div className="userMbti">

        </div>

        {/*서버에서 mbti 정보 가져올 부분*/}
        <div className="detailMbti">

        </div>

        <div className="btns">
            <button onClick={gotoHome}>홈</button>
            <button onClick={gotoAdmin}>관리자 페이지</button>
        </div>

        <div className="lowerTitle"></div>

     </div>
    );
}
export default resultPage;
